/**
 * @param {number[][]} maze
 * @param {number[]} start
 * @param {number[]} destination
 * @return {boolean}
 */
var hasPath = function(maze, start, destination) {
  const offsets = [[0, 1], [1, 0], [0, -1], [-1, 0]];
  const queue = [start];
  let success = false;

  while (!success && queue.length) {
    const current = queue.shift();

    offsets.forEach((offset) => {
      if (success) return;

      const [rowOffset, colOffset] = offset;
      let candidate, next = current;

      while (maze[next[0]][next[1]] !== 1) {
        candidate = next;
        next = [candidate[0] + rowOffset, candidate[1] + colOffset];
        if (maze[next[0]] === undefined || maze[next[0]][next[1]] === undefined) break;
      }

      if (candidate[0] === destination[0] && candidate[1] === destination[1]) success = true;

      if (maze[candidate[0]][candidate[1]] !== 2) {
        maze[candidate[0]][candidate[1]] = 2
        queue.push(candidate);
      }
    });
  }

  return success;
};

